    \begin{document}
    \begin{tikzpicture}[scale=0.8]
    % Draw the grid
    \draw[very thin, gray] (0,0) grid (15,15);

    % Draw the axes
    \draw[->] (0,0) -- (15,0) node[right] {x};
    \draw[->] (0,0) -- (0,15) node[above] {y};

    % Mark the axes
    \foreach \x in {0, 1, ..., 15} \draw (\x,0.2) -- (\x,-0.2) node[below] {\x};
    \foreach \y in {0, 1, ..., 15} \draw (0.2,\y) -- (-0.2,\y) node[left] {\y};

    % Draw the staircase-like function
    \draw[thick] (0,15) -- (5,10) -- (8,3) -- (12,3) -- (15,0);

    % Open circle at (5,10)
    \draw[open circle, fill=white] (5,10) circle (5pt);

    % Filled circles at (8,3) and (12,3)
    \fill (8,3) circle (5pt);
    \fill (12,3) circle (5pt);

    % Squares for N(U)
    \fill[black] (1,7) rectangle (2,8);
    \fill[black] (3,7) rectangle (4,8);
    \fill[black] (5,7) rectangle (6,8);
    \fill[black] (7,7) rectangle (8,8);

    % Shaded area under U
    \fill[blue!30] (0,0) -- (0,15) -- (5,10) -- (0,10) -- cycle;

    % Crosshatched area under the staircase
    \begin{scope}
        \clip (5,10) -- (8,3) -- (12,3) -- (15,0) -- (15,0) -- (5,0) -- cycle;
        \fill[pattern=checkerboard, pattern color=gray!30] (5,10) -- (8,3) -- (12,3) -- (15,0) -- (15,0) -- (5,0) -- cycle;
    \end{scope}

    % Legend
    \draw[thick] (12,12) -- (13,12) node[right] {U (plus signs)};
    \fill (12,11) circle (5pt);
    \draw[thick] (12,10) -- (13,10) node[right] {N(U) (squares)};
    \fill[black] (12,9) rectangle (12.5,9.5);
    \draw[thick] (12,8) -- (13,8) node[right] {L(η) (line)};
    \draw[thick] (12,7) -- (12.5,7) -- (12.5,6);
\end{tikzpicture}
    \end{document}

