    \node (ctis) [draw, rectangle, right=of cti_elim] {CTIs};
    \node (ind) [draw, rectangle, below=of $(cti_elim)!0.5!(ctis)$] {Ind};

    % Draw arrows
    \draw[->] (spec) -- ++(0,-0.5) -- (inv);
    \draw[->] (safe) -- ++(0,-0.5) -- (inv);
    \draw[->] (inv) -- (i_new);
    \draw[->] (inv_gen) -- (inv);
    \draw[->] (inv_gen) -- (cti_elim);
    \draw[->] (cti_elim) -- (ctis);

    % Output arrows
    \draw[->] (ctis) -- ++(0,-0.5) -- (ind);

    % Conditional connection
    \node (cond) [draw, rectangle, below=of inv, text width=3cm] {I $\subseteq$ Invs};
