        \node at (4.3,\i) {c\i};
    }
    \foreach \i in {1,2,3,4,5} {
        \draw[->] (0,\i) -- (2,\i); % Connections from a to b
        \ifnum\i=2 \draw[->] (2,\i) -- (4,2); \draw[->] (2,\i) -- (4,3); \fi
        \ifnum\i=4 \draw[->] (2,\i) -- (4,4); \draw[->] (2,\i) -- (4,5); \fi
    }

    % Structure S''
    \foreach \i in {1,2,3,4,5} {
        \draw (7,\i) -- (9,\i); % Horizontal lines for a1 to a5
        \node at (6.7,\i) {a\i};
    }
    \foreach \i in {1,2,3,4,5} {
