        \node at (11.3,\i) {c\i};
    }
    \foreach \i in {1,2,3,4,5} {
        \draw[->] (7,\i) -- (9,\i); % Connections from a to b
        \ifnum\i=2 \draw[->] (9,\i) -- (11,2); \draw[->] (9,\i) -- (11,3); \fi
        \ifnum\i=4 \draw[->] (9,\i) -- (11,4); \draw[->] (9,\i) -- (11,5); \fi
    }
